import React from "react";
import PostsCatalog from "../components/PostsCatalog";

const DUMMY_POSTS = [
  {
    id: "p1",
    imageUrl:
      "https://www.google.com/url?sa=i&url=https%3A%2F%2Ftanglesandtravels.com%2F2016%2F08%2F06%2Fsunset-in-calatagan-batangas%2F&psig=AOvVaw2O4N-gfGvU1Ghcz24n6CB-&ust=1596961878109000&source=images&cd=vfe&ved=0CAIQjRxqFwoTCNjFr96Yi-sCFQAAAAAdAAAAABAT",
    location: "Binubusan, Lian, Batangas",
    description:
      "Ang magandang kabundukin at karagatan dito sa Matuod, Binubusan.",
    coordinates: {
      lat: 13.9783756,
      lng: 120.62508,
    },
    creator: "u1",
  },
  {
    id: "p2",
    imageUrl:
      "https://scontent.fmnl4-5.fna.fbcdn.net/v/t31.0-8/19055741_10155252126151438_789617044440834124_o.jpg?_nc_cat=111&_nc_sid=e3f864&_nc_eui2=AeFXkl3BuabFRdKyg6owJc2vcCu9CORMv2ZwK70I5Ey_ZiSA_ebmUdNTlxoxjsLjR-kyJw6aR_kgUu4XcnLAprNm&_nc_ohc=EdXBFUF4l8gAX8dht3q&_nc_ht=scontent.fmnl4-5.fna&oh=11b7f2e0b83838277e9e8aa206a94670&oe=5F55776B",
    location: "Binubusan, Lian, Batangas",
    description:
      "Ang magandang kabundukin at karagatan dito sa Matuod, Binubusan.",
    coordinates: {
      lat: 13.9783756,
      lng: 120.62508,
    },
    creator: "u2",
  },
];

const UserPosts = (props) => {
  return <PostsCatalog bits={DUMMY_POSTS} />;
};

export default UserPosts;
